import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Provedor from './context/Provedor';

function App() {
  return (
    <Provedor>
      <Router>
        <Switch>
      <p>oie</p>
      </Switch>
      </Router>
    </Provedor>
  );
}

export default App;
